  false,\n\t\"url\": null,\n\t\"notes\": \"Moored current meter data were collected
  from the Bering Sea from 17 September 1993 to 31 March 1996. Data were collected
  by the Pacific Marine Environmental Laboratory (PMEL) as part as part of the Fisheries-Oceanography
  Cooperative Investigations (FOCI). Current meter parameters include East/West velocity
  components (U), North/South velocity component (V), current speed, current direction,
  salinity, pressure, conductivity, and temperature. Data are not in standard formats
  and are self documenting.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
